import React from 'react';

const herissonBase64 =
  'data:image/svg+xml;base64,';

export class Herisson extends React.Component<
  React.DetailedHTMLProps<React.HTMLAttributes<HTMLImageElement>, HTMLImageElement>,
  {}
> {
  public static displayName = 'Herisson';

  public render(): JSX.Element {
    return <img {...this.props} src={herissonBase64} />;
  }
}
